import React from "react";
import styled from "styled-components";

const NavContainer = styled.div`
	width: 100vw;
	z-index: 6;
	position: absolute;
	top: 0;

	display: flex;
	justify-content: center;
`;

const Navbar = () => {
	return (
		<NavContainer>
			<li>Menu</li>
		</NavContainer>
	);
};

export default Navbar;
